; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"902684","type":"CustomJS"},{"attributes":{},"id":"902542","type":"LinearScale"},{"attributes":{"label":{"value":"Max Dd Dur. (1825 days)"},"renderers":[{"id":"902464"}]},"id":"902486","type":"LegendItem"},{"attributes":{"active_drag":{"id":"902317"},"active_scroll":{"id":"902318"},"tools":[{"id":"902317"},{"id":"902318"},{"id":"902319"},{"id":"902320"},{"id":"902321"},{"id":"902322"},{"id":"902323"},{"id":"902682"},{"id":"902685"}]},"id":"902325","type":"Toolbar"},{"attributes":{"label":{"value":"mad(C)"},"renderers":[{"id":"902665"}]},"id":"902679","type":"LegendItem"},{"attributes":{"days":["%d %b","%a %d"],"months":["%m/%Y","%b'%y"]},"id":"902338","type":"DatetimeTickFormatter"},{"attributes":{},"id":"902360","type":"UndoTool"},{"attributes":{},"id":"902631","type":"DataRange1d"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[
